package coder;

/**
 * Clase que contiene las llaves para el cifrado de los codigos USSD en
 * dependencia de la versión.<\br>
 * Idealmente, si en algun momento ETECSA cambia algo en el cifrado debe ser la
 * llave, estadísticamente es poco probable que se cambie todo el cifrado, por
 * lo tanto sólo se debe agregarle a esta clase el código de otra versión.
 *
 * @author Jesús Hernández Barrios (jhernandezb96@gmail.com)
 */
public class VersionCode {

    //Don't touch, one code for every version, if ETECSA change the codes, only add another variable with the updated info
    public static final VersionCode CODE_VERSION_11811022182382 = new VersionCode("11811022182382", "1181102", "");
    public static final VersionCode CODE_VERSION_70809152182382 = new VersionCode("70809152182382", "1200309", "");

    public static final VersionCode ACTUAL_VERSION = CODE_VERSION_70809152182382;

    private String code_version;
    private String crude_code;
    private String transfer_version;

    public VersionCode(String code_version, String transfer_version, String crude_code) {
        this.code_version = code_version;
        this.crude_code = crude_code;
        this.transfer_version = "1200309";
    }

    public String getCode_version() {
        return code_version;
    }

    public String getCrude_code() {
        return crude_code;
    }

    public String getTransfer_version() {
        return transfer_version;
    }

    @Override
    public String toString() {
        return "Version=" + code_version + ", Crude=" + crude_code + ", Transfer=" + transfer_version;
    }

}
